import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  Nav,
  Form,
} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.css';
import classes from "./NavigBar.module.css";
function NavigBar() {
  return (
    <div>
        <Navbar bg='light'>
            <Nav>
            <Button >Hit</Button>
            <Navbar.Brand className={classes.bb}>Uber Eats</Navbar.Brand>
            <ButtonGroup >
  <Button variant="secondary">Left</Button>
  <Button variant="secondary">Middle</Button>

</ButtonGroup>

            </Nav>

        </Navbar>


    </div>
  );
}
export default NavigBar;
